import React from "react";

const NumberIndex = (props) => {
  return (
    <div
      className="number"
      style={{ opacity: props.position === "0" ? 0.2 : 1 }}
    >
      {props.position === "0" ? Math.floor(Math.random() * 10) : props.position}
    </div>
  );
};

export default NumberIndex;
